interface IUniswapV2Factory {
    function createPair(address tokenA, address tokenB)
        external
        returns (address pair);
}

interface IUniswapV2Router01 {
    function factory() external pure returns (address);

    function WETH() external pure returns (address);
}

contract DST is Context, IERC20, Ownable {
    using SafeMath for uint256;
    using Address for address;

    mapping(address => uint256) private _rOwned;
    mapping(address => uint256) private _tOwned;
    mapping(address => mapping(address => uint256)) private _allowances;

    mapping(address => bool) private _isExcludedFromFee;
    mapping(address => bool) public ammPairs;

    mapping(address => bool) private _isExcluded;
    address[] private _excluded;

    uint256 private constant MAX = ~uint256(0);
    uint256 private _tTotal = 100_000 * 1e9 * 10**18;
    uint256 private _rTotal = (MAX - (MAX % _tTotal));
    uint256 private _tFeeTotal;

    string private _name = "DoctorS Token";
    string private _symbol = "DST";
    uint8 private _decimals = 18;

    uint256 public _buyTaxFee = 4;
    uint256 public _buyAdvestisementFee = 2;
    uint256 public _buyDonateFee = 0;

    uint256 public _sellTaxFee = 4;
    uint256 public _sellAdvestisementFee = 2;
    uint256 public _sellDonateFee = 4;

    uint256 private _taxFee = _buyTaxFee;
    uint256 private _previousTaxFee = _taxFee;

    uint256 private _burnFee = 2;
    uint256 private _previousBurn = _burnFee;

    address public advertisementWallet = 0xfAA30f9D0bf9507d8Db1f4F51C876e89011fEF23;
    address public donateWallet = 0x1b1970bBC53f1798C29F7B7C090070A4aB64B8EF;

    uint256 public _advestisementFee = _buyAdvestisementFee;
    uint256 private _previousAdvestisementFee = _advestisementFee;

    uint256 private _donateFee = _buyDonateFee;
    uint256 private _previousDonateFee = _donateFee;

    address public constant DEAD_ADDRESS =
        0x000000000000000000000000000000000000dEaD;

    uint256 public _maxTxAmount = 10_000 * 1e9 * 10**18;

    bool isAntibotModeEnabled = true;
    bool isDisabledAirdropSell = true;
    address airdropContract;
    mapping(address => bool) antibotModeWhitelist;
    mapping (address => bool) airdropWhitelist;

    constructor() public {
        _rOwned[_msgSender()] = _rTotal;

        IUniswapV2Router01 _uniswapV2Router = IUniswapV2Router01(
            0x10ED43C718714eb63d5aA57B78B54704E256024E
        );
        // Create a uniswap pair for this new token
        address _uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), _uniswapV2Router.WETH());

        ammPairs[_uniswapV2Pair] = true;

        _isExcludedFromFee[owner()] = true;
        _isExcludedFromFee[address(this)] = true;

        excludeFromReward(DEAD_ADDRESS);

        emit Transfer(address(0), _msgSender(), _tTotal);
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function changeAdvestisementWallet(address wallet) public onlyOwner {
        advertisementWallet = wallet;
    }

    function changeDonateWallet(address wallet) public onlyOwner {
        donateWallet = wallet;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _tTotal;
    }

    function balanceOf(address account) public view override returns (uint256) {
        if (_isExcluded[account]) return _tOwned[account];
        return tokenFromReflection(_rOwned[account]);
    }

    function transfer(address recipient, uint256 amount)
        public
        override
        returns (bool)
    {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender)
        public
        view
        override
        returns (uint256)
    {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount)
        public
        override
        returns (bool)
    {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(
            sender,
            _msgSender(),
            _allowances[sender][_msgSender()].sub(
                amount,
                "ERC20: transfer amount exceeds allowance"
            )
        );
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue)
        public
        virtual
        returns (bool)
    {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].add(addedValue)
        );
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue)
        public
        virtual
        returns (bool)
    {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].sub(
                subtractedValue,
                "ERC20: decreased allowance below zero"
            )
        );
        return true;
    }

    function isExcludedFromReward(address account) public view returns (bool) {
        return _isExcluded[account];
    }

    function totalFees() public view returns (uint256) {
        return _tFeeTotal;
    }

    function reflectionFromToken(uint256 tAmount, bool deductTransferFee)
        public
        view
        returns (uint256)
    {
        require(tAmount <= _tTotal, "Amount must be less than supply");
        (uint256[3] memory rValues,) = _getValues(tAmount);
        if (!deductTransferFee) {
            uint256 rAmount = rValues[0];
            return rAmount;
        } else {
            uint256 rTransferAmount = rValues[1];
            return rTransferAmount;
        }
    }

    function tokenFromReflection(uint256 rAmount)
        public
        view
        returns (uint256)
    {
        require(
            rAmount <= _rTotal,
            "Amount must be less than total reflections"
        );
        uint256 currentRate = _getRate();
        return rAmount.div(currentRate);
    }

    function excludeFromReward(address account) public onlyOwner {
        require(!_isExcluded[account], "Account is already excluded");
        if (_rOwned[account] > 0) {
            _tOwned[account] = tokenFromReflection(_rOwned[account]);
        }
        _isExcluded[account] = true;
        _excluded.push(account);
    }

    function includeInReward(address account) external onlyOwner {
        require(_isExcluded[account], "Account is already excluded");
        for (uint256 i = 0; i < _excluded.length; i++) {
            if (_excluded[i] == account) {
                _excluded[i] = _excluded[_excluded.length - 1];
                _tOwned[account] = 0;
                _isExcluded[account] = false;
                _excluded.pop();
                break;
            }
        }
    }

    function _transferBothExcluded(
        address sender,
        address recipient,
        uint256 tAmount
    ) private {
        (
            uint256[3] memory rValues,
            uint256[5] memory tValues
        ) = _getValues(tAmount);
        uint256 rAmount = rValues[0];
        uint256 rTransferAmount = rValues[1];
        uint256 rFee = rValues[2];
        uint256 tTransferAmount = tValues[0];
        uint256 tFee = tValues[1];
        uint256 tAdvertisement = tValues[2];
        uint256 tDonate = tValues[3];
        uint256 tBurn = tValues[4];
        address _sender = sender;
        address _recipient = recipient;
        _tOwned[_sender] = _tOwned[_sender].sub(tAmount);
        _rOwned[_sender] = _rOwned[_sender].sub(rAmount);
        _tOwned[_recipient] = _tOwned[_recipient].add(tTransferAmount);
        _rOwned[_recipient] = _rOwned[_recipient].add(rTransferAmount);
        _takeAdvertisement(tAdvertisement);
        _takeDonate(tDonate);
        _reflectFee(rFee, tFee);
        _takeBurn(tBurn);
        emit Transfer(_sender, _recipient, tTransferAmount);
    }

    function excludeFromFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = true;
    }

    function excludesFromFee(address[] memory addresses) public onlyOwner {
        for (uint256 i = 0; i < addresses.length; i++)
            _isExcludedFromFee[addresses[i]] = true;
    }

    function manageAmmPairs(address pair, bool isAdd) public onlyOwner {
        ammPairs[pair] = isAdd;
    }

    function includeInFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = false;
    }

    function setMaxTxPercent(uint256 maxTxPercent) external onlyOwner {
        _maxTxAmount = _tTotal.mul(maxTxPercent).div(10**3);
    }

    function _reflectFee(uint256 rFee, uint256 tFee) private {
        _rTotal = _rTotal.sub(rFee);
        _tFeeTotal = _tFeeTotal.add(tFee);
    }

    function _getValues(uint256 tAmount)
        private
        view
        returns (
            uint256[3] memory,
            uint256[5] memory
        )
    {
        (
            uint256 tTransferAmount,
            uint256 tFee,
            uint256 tAdvertisement,
            uint256 tDonate,
            uint256 tBurn
        ) = _getTValues(tAmount);
        (uint256 rAmount, uint256 rTransferAmount, uint256 rFee) = _getRValues(
            tAmount,
            tFee,
            tAdvertisement,
            tDonate,
            tBurn,
            _getRate()
        );
        return (
